// src/pages/VendorsPage.js
import React from 'react';

const VendorsPage = () => {
  return (
    <div>
      <h1>Available Vendors</h1>
      <p>Vendor listings will appear here...</p>
      <div>
        <h2>Caterers</h2>
        <p>Catering services...</p>
      </div>
      <div>
        <h2>Photographers</h2>
        <p>Photography services...</p>
      </div>
      <div>
        <h2>DJs</h2>
        <p>Music services...</p>
      </div>
    </div>
  );
};

export default VendorsPage;
